import React from "react";


const Columns = ({columns}) => {
    return (
        <section className="columnsText">
         <div className="container">
             <p>{columns.heading}</p>
             {columns.map((column) =>{
                 return(
                     <div className="item">
                       <h2>{column.heading}</h2>
                       <p>{column.textColumn}</p>
                     </div>
                 );
             })}

         </div>
        </section>
    );
};

export default Columns;
